`;


export const Skills = () => (
    <div>
        <h1>Slills</h1>
        <p>  virtual reality glove that allows a natural exploration in a virtual reality environment while also being affordable and open source. All the components are off-the-shelf, allowing anyone to built and create a vitual reality glove. The Ranger Glove is using an MIT License.  </p>
    </div>
